CIENTE CON LA FINALIDAD DE LOGRAR EL EFECTO NUTRIMENTAL O FISIOLÓGICO DE ÉSTA SOBRE LA BASE DE LAS CANTIDADES PRESENTES EN LA LECHE MATERNA Y PARA ASEGURARSE QUE SEA ADECUADO COMO FUENTE ÚNICA DE LA NUTRICIÓN DEL LACTANTE. SU IDONEIDAD E INOCUIDAD DEBE ESTAR DEMOSTRADA CIENTÍFICAMENTE. SE DEBE CONTAR CON EVIDENCIA CIENTÍFICA QUE DEMUESTRE LA UTILIDAD DE LOS NUTRIMENTOS/INGREDIENTES OPCIONALES QUE SE UTILICEN Y ESTAR A DISPOSICIÓN DE LA SECRETARÍA DE SALUD CUAN DO ÉSTA LO SOLICITE. LAS FÓRMULAS QUE CONTENGAN MÁS DE 18 G DE PROTEÍNAS POR CADA 100 KCAL DEBEN INCREMENTAR EL CONTENIDO DE PIRIDOXINA EN AL MENOS 15 µG DE PIRIDOXINA POR CADA GRAMO DE PROTEÍNA ARRIBA DE DICHO VALOR. EN LA FÓRMULA LISTA PARA SER CONSUMIDA DE ACUERDO CON LAS INSTRUCCIONES DESCRITAS EN LA ETIQUETA. LAS INSTITUCIONES PODRÁN SOLICITAR QUE SE ESPECIFIQUE EL ORIGEN DEL HIDROLIZADO DE PROTEÍNA Y EN CASO DE SER MIXTO LA RELACIÓN DE LA MISMA LO CUAL SERÁ EXPRESADO EN LA FICHA TÉCNICA. SI SE AÑADE ÁCIDO DOCOSAHEXAENOICO (DHA) EL CONTENIDO DE ÁCIDO ARAQUIDÓNICO DEBE SER AL MENOS EL MISMO QUE EL DE DHA Y EL CONTENIDO DE ÁCIDO EICOSAPENTAENOICO (EPA) NO DEBE EXCEDER EL CONTENIDO DE DHA. ** OPCIONAL S.E. SIN ESPECIFICACIÓN NSR: NIVEL SUPERIOR DE REFERENCIA. ENVASE DESDE 357 G HASTA 450 G POLVO Y MEDIDA DOSIFICADORA.', 'PIEZA', false, NULL, true, '2025-10-06 14:57:10.10102+00', '2025-10-06 15:17:59.904575+00', 1);
