 ESTAR A DISPOSICIÓN DE LA SECRETARÍA DE SALUD CUANDO ÉSTA LO SOLICITE. LAS FÓRMULAS QUE CONTENGAN MÁS DE 1,8 G DE PROTEÍNAS POR CADA 100 KCAL, DEBEN INCREMENTAR EL CONTENIDO DE PIRIDOXINA EN AL MENOS 15 µG DE PIRIDOXINA POR CADA GRAMO DE PROTEÍNA ARRIBA DE DICHO VALOR. EN LA FÓRMULA LISTA PARA SER CONSUMIDA DE ACUERDO CON LAS INSTRUCCIONES DESCRITAS EN LA ETIQUETA. SI SE AÑADE ÁCIDO DOCOSAHEXAENOICO (DHA), EL CONTENIDO DE ÁCIDO ARAQUIDÓNICO DEBE SER AL MENOS EL MISMO QUE EL DE DHA Y EL CONTENIDO DE ÁCIDO EICOSAPENTAENOICO (EPA) NO DEBE EXCEDER EL CONTENIDO DE DHA. ** OPCIONAL. S.E. SIN ESPECIFICACIÓN. NSR: NIVEL SUPERIOR DE REFERENCIA. ENVASE DESDE 360 G HASTA 454 G POLVO Y MEDIDA DOSIFICADORA.', 'PIEZA', false, NULL, true, '2025-10-06 14:57:14.213051+00', '2025-10-06 15:17:59.890629+00', 1);
